import React, { useContext } from 'react';
import { AuthContext } from '../context/AuthContext';
import Footer from './';



const HomePage = () => {
  const { user } = useContext(AuthContext);

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-2xl font-bold">Welcome to the Startup Board</h1>
      <p>Your hub for startups and investors to connect and collaborate.</p>
      {user ? (
        <p className="mt-4">Hello, {user.name}!</p>
      ) : (
        <p className="mt-4">Please log in to access more features.</p>
      )}
      <Footer />
    </div>
  );
};

export default HomePage;
